import React, { Component } from 'react';
import { Card, Row, Col, Container, Form, Button, Breadcrumb } from 'react-bootstrap';
import student from '../assets/student.png';
import teacher from '../assets/professor.png';
import parent from '../assets/family.png';
import admin from '../assets/adm.ico';
import schedule from '../assets/calendar.png';

import './Profile.css';

export default class Profile extends Component {
    render() {
        return (
            <div>
                <main role="main" className="inner cover">
                    <Row>
                        <Col>
                            <Card style={{ width: '10rem', height: '15rem' }}>
                                <Card.Img variant="top" src={admin} class="center" variant="left" style={{ width: '40%' }} />
                                <Card.Body>
                                    <Card.Title className="center-text">ADMIN</Card.Title>
                                </Card.Body>
                            </Card>
                        </Col>
                        <Col>
                       <Card style={{ width: '10rem', height: '15rem' }}> 
                                <Card.Img variant="top" src={parent} class="center" variant="left" style={{ width: '40%' }} />
                                <Card.Body>
                                    <Card.Title className="center-text">GUARDIANS</Card.Title>
                                </Card.Body>
                            </Card>
                        </Col>
                        <Col>
                        <Card style={{ width: '10rem', height: '15rem' }}> 
                                <Card.Img variant="top" src={student} class="center" variant="left" style={{ width: '40%' }} />
                                <Card.Body>
                                    <Card.Title className="center-text">STUDENTS</Card.Title>
                                </Card.Body>
                            </Card>
                        </Col>
                        <Col>
                        </Col>
                    </Row>
                </main>
            </div>
        )
    }
}
